import React from "react"
import styled from "@emotion/styled"

const logo = (props) => {
  const Logo = styled.div``
  const LogoAnchor = styled.a`
    color: white;
    text-decoration: none;
    font=size: 2rem;
  `
  return (
    <Logo>
      <LogoAnchor href="/">THE LOGO</LogoAnchor>
    </Logo>
  )
}

export default logo
